      <p>If you have any questions, feel free to contact us using the information below.</p>
      <p>Phone: +1-800-123-4567</p>
      <p>Last updated on 07-10-2024 22:28:21</p>
      <p>You may contact us using the information below:</p>
      <p>Merchant Legal entity name: HRITIK SAGAR SRIVASTAVA </p>
      <p>Registered Address: 1166/23/47/122C kidwai Nagar Allahpur, Prayagraj, Uttar Pradesh, PIN: 211006</p>
      <p> Operational Address: 1166/23/47/122C kidwai Nagar Allahpur, Prayagraj, Uttar Pradesh, PIN: 211006</p>
      <p>Telephone No: 9453930121</p>
     <p>Email: <a href="hritik.srivastava28@gmail.com">lol.shruti@pllatinum.tech</a></p>
    </div>
  );
}

export default Contact;
